INSERT INTO `books` (`title`, `image`, `author`, `description`, `year`, `isbn`) VALUES
('El viento conoce mi nombre', , 'Isabel Allende', 'Viena, 1938. Samuel Adler es un niño judío de seis años cuyo padre desaparece durante la Noche de los Cristales Rotos, en la que su familia lo pierde todo. Su madre, desesperada, le consigue una plaza en un tren que le llevará desde la Austria nazi hasta Inglaterra. Samuel emprende una nueva etapa con su fiel violín y con el peso de la soledad y la incertidumbre, que lo acompañarán siempre en su dilatada vida.', 2023, 9788401032004);
INSERT INTO `books` (`title`, `image`, `author`, `description`, `year`, `isbn`) VALUES
('Mujeres que corren con los lobos', , 'Clarissa Pinkola Estés', '«En toda mujer hay fuerzas poderosas pendientes de descubrir.»\r\nMujeres que corren con los lobos es un fascinante mosaico de historias que nos ofrece una nueva visión de lo femenino y de sus posibilidades.\r\n\r\nDentro de toda mujer alienta una vida secreta, una fuerza poderosa llena de buenos instintos, creatividad y sabiduría. Es la Mujer Salvaje, una especie en peligro de extinción debido a los contantes esfuerzos de la sociedad por «civilizar» a las mujeres y constreñirlas a rígidos papeles que anulan su esencia instintiva.', 1989, 9788413141213);
INSERT INTO `books` (`title`, `image`, `author`, `description`, `year`, `isbn`) VALUES
('Biografía del Silencio', , 'Pablo D\'or', 'Basta un año de meditación perseverante, o incluso medio, para percatarse de que se puede vivir de otra forma. La meditación agrieta la estructura de nuestra personalidad hasta que, de tanto meditar, la grieta se ensancha y la vieja personalidad se rompe y, como una flor, comienza a nacer una nueva. Meditar es asistir a este fascinante y tremendo proceso de muerte y renacimiento.', 2020, 9788417971717);
INSERT INTO `books` (`title`, `image`, `author`, `description`, `year`, `isbn`) VALUES
('Hábitos Atómicos', , 'James Clear', 'A menudo pensamos que para cambiar de vida tenemos que pensar en hacer cambios grandes. Nada más lejos de la realidad. Según el reconocido experto en hábitos James Clear, el cambio real proviene del resultado de cientos de pequeñas decisiones: hacer dos flexiones al día, levantarse cinco minutos antes o hacer una corta llamada telefónica.\r\n\r\n\r\nClear llama a estas decisiones “hábitos atómicos”: tan pequeños como una partícula, pero tan poderosos como un tsunami. En este libro innovador nos revela exactamente cómo esos cambios minúsculos pueden crecer hasta llegar a cambiar nuestra carrera profesional, nuestras relaciones y todos los aspectos de nuestra vida.\r\n\r\n', 2020, 9788418118036);
INSERT INTO `books` (`title`, `image`, `author`, `description`, `year`, `isbn`) VALUES
('El segundo Sexo', , 'Simone De Beauvoir', '\" El segundo sexo \" , que es el ensayo de una filósofa existencialista, se encuadra en el ámbito más amplio de un pensamiento ilustrado que toma de la ilustración precisamente sus aspectos positivos, emancipatorios; ante todo, una concepción igualitaria de los seres humanos, según la cual la diferencia de sexos no altera su radical igualdad de condición.\r\n\r\nAl mismo tiempo, es un ensayo filosófico que analiza el hecho de la condición femenina en las sociedades occidentales desde múltiples puntos de vista: el científico, el histórico, el psicológico, el sociológico, el ontológico y el cultural. Se trata de un estudio totalizador donde se investiga el porqué de la situación en que se encuentra esa mitad de la humanidad que somos las mujeres.\r\n\r\n', 2017, 9788437637365);
INSERT INTO `books` (`title`, `image`, `author`, `description`, `year`, `isbn`) VALUES
('Etica para Celia', , 'Ana de Miguel', 'Este libro no es solo una ética para chicas, es también una llamada a los chicos para que se atrevan a transgredir de verdad: para que dejen de ponerse en el lugar de sus deseos y se pongan en el lugar de las demás.', 2021, 9788466665537);
INSERT INTO `books` (`title`, `image`, `author`, `description`, `year`, `isbn`) VALUES
('Etica del Despiadado', , 'Adriana Royo', 'Este libro se dirige a todos aquellos que estén cansados de ser demasiado serviciales y demasiado complacientes por miedo a que los abandonen. A aquellos que evitan el conflicto por miedo al rechazo.', 2020, 9788466668361);
INSERT INTO `books` (`title`, `image`, `author`, `description`, `year`, `isbn`) VALUES
('Las 48 Leyes del poder', , 'Robert Greene', '“(El libro que) te enseña a fingir, esquivar y luchar por tu causa en el mundo moderno”\r\n\r\nIndependent on Sunday\r\n\r\n “Por fin el libro que te ayuda a plantear tu estrategia para llegar a los escalones más altos del poder”\r\n\r\ndaily Express\r\n\r\n “Una clase magistral propia de Maquiavelo”\r\n\r\nSunday times', 1999, 9788467028904);
INSERT INTO `books` (`title`, `image`, `author`, `description`, `year`, `isbn`) VALUES
('El Libro de la Sabiduría', , 'OSHO', 'No se trata de una filosofía. Es un manual de transformación interior.Es el libro que puede ayudar a crecer en sabiduría.Yo lo llamo El Libro de la Sabiduría', 2009, 9788484452461);
INSERT INTO `books` (`title`, `image`, `author`, `description`, `year`, `isbn`) VALUES
('El brillo de las luciernagas', , 'Paul Pen', 'Unthriller que engancha de mano del apodado como «Stephen King español».\r\n\r\nVivo en la oscuridad con mis padres, mi abuela, mi hermana y mi hermano. Todos están desfigurados por el fuego. Mi hermana lleva una máscara blanca para tapar sus quemaduras, porque papá dice que su cara podría asustarme.\r\n\r\nMe gusta mi cactus. Me gusta leer mi libro sobre insectos. Y tocar durante horas el único rayo de sol que se filtra por una rendija del techo. Pero desde que mi hermana tuvo al bebé, todos actúan de forma extraña. Creo que mienten sobre quién es el padre, sobre el hombre grillo que acecha por las noches, sobre lo que sucedió antes de que yo naciera, sobre por qué estamos aquí encerrados.', 2014, 9788490328224);
INSERT INTO `books` (`title`, `image`, `author`, `description`, `year`, `isbn`) VALUES
('Never Ending Story', , 'Michael Ende', 'La Emperatriz Infantil está mortalmente enferma y su reino corre un grave peligro. La salvación depende de Atreyu, un valiente guerrero de la tribu de los pieles verdes, y Bastián, un niño tímido que lee con pasión un libro mágico. Mil aventuras les llevarán a reunirse y a conocer una fabulosa galería de personajes, y juntos dar forma a una de las grandes creaciones de la literatura de todos los tiempos.', 1993, 9788491220787);
INSERT INTO `books` (`title`, `image`, `author`, `description`, `year`, `isbn`) VALUES
('La Maestría del Amor', , 'Don Miguel Ruíz', 'No nos resulta difícil imaginar que todas y cada una de nuestras relaciones interpersonales podrían mejorar. Porque son muchos los supuestos y las creencias que, basados en el miedo, socavan el amor y originan conflictos y sufrimiento en nuestras relaciones. \"La felicidad solo puede provenir de tu interior y es el resultado de tu amor. Cuando te des cuenta de que ninguna otra persona puede hacerte feliz y que la felicidad es el resultado de tu amor, habrás conseguido la más importante de las maestrías.\"', 2001, 9788499443331);

